import React from 'react'
import MoreVertIcon from '@mui/icons-material/MoreVert';

import Search from './Search'
import Options from '../general/Options';

export default function SideBarHeader({ openModal, isMobile, isOptionsOpen }) {
    return (
        <header className="side-bar-header flex">
            <h1>chatMe</h1>
            {isMobile && <Search />}
            <button className='options-btn'><MoreVertIcon/></button>
            {isOptionsOpen && <Options/>}
            {/* <button onClick={openModal} className="new-chat-btn">+</button> */}
        </header>
    )
}
